import React from 'react';
import './App.css';
import getToken from './api/OAuth'

const App = () => {
  const handleOnClick = () => {
    const token = getToken();
    alert(token);
  };

  return (
    <div className="App">
      <button
        onClick={handleOnClick}
      >Click Me</button>
    </div>
  );
};

export default App;
